import React from 'react';
import './App.css';

function BoxHead(props){
  const headItems = props.head.map((item)=><th>{item}</th>);
  return (<tr>{headItems}</tr>);
}

function BoxRow(props){
  const items = props.row.map(
    (item)=>
      <tr>
       <td>{item.num}</td>
       <td>{item.name}</td>
       <td>{item.person}</td>
       <td>{item.amount}</td>
       <td>{item.other}</td>
      </tr>
  );
  return items 
}

function Box(props){
  return (
    <table className="table table-striped">
      <BoxHead head={["No","Name", "Person", "Type", "Other"]}/>
      <tr> 
        <td>{props.num}</td>
        <td>{props.name}</td>
        <td>{props.person}</td>
        <td>{props.amount}</td>
        <td>{props.other}</td>
      </tr>
    </table>
  );
}

function App() {
  return (
    <div className="App">
    <h1>Hello</h1>
    <Box num="2" name="mike" person="lola's human" amount="100%"/>
    </div>
  );
}

export default App;
